import React from 'react'
import Navbar from '../Navbar'
import  './Landingpage.css'

function Landingpage() {
  return (
    <div>
        <Navbar/>
        <img style={{width:"100%",height:"700px"}} src="https://img.freepik.com/free-photo/man-using-his-car-s-options-while-driving_23-2149149572.jpg?w=996&t=st=1701787711~exp=1701788311~hmac=56cb827a11c07536bb967dd90fc5d65140dbf4520bcf9fb8646335b4fe19666e" alt="" />
       <b> <h1 className='h3'>Experience the Drive</h1></b>
    </div>
  )
}

export default Landingpage
